  return (
    <AuthLayout title="Sign in to DineEase">
      <h1>Sign in</h1>
      <p>
        You can{" "}
        <Link to="/register" className="font-semibold text-primary-darker">
          Register here
        </Link>
      </p>
    </AuthLayout>
  );
};

export default LoginPage;
